import React from "react";
import styled from "styled-components";

const InfoConteiner = styled.div`
  padding-left: 24px;
  @media (max-width: 768px) {
    border-radius: 8.11px;
    box-shadow: 0px 4.05px 5.68px 0px rgba(0, 0, 0, 0.03);
    margin: 44px auto;
    background-color: rgba(254, 254, 254, 1);
    height: 100%;
    padding-left: 0px;
    margin-top: -9vh;
  }
  @media (max-width: 550px) {
    margin-top: -4vh;
  }
  @media (max-width: 400px) {
    margin-top: 0vh;
  }
`;
const Name = styled.div`
  font-family: "TTFirsNeueBold";
  font-size: 20px;
  color: black;
  margin-top: 20px;
  @media (max-width: 768px) {
    margin-left: 21px;
  }
`;
const Position = styled.div`
  font-family: "TTFirsNeue400";
  font-size: 14px;
  color: #455773;
  margin-top: 10px;
  @media (max-width: 768px) {
    margin-left: 21px;
  }
`;
const VectorTop = styled.div`
  margin-top: 35px;
  width: 336px;
  height: 1px;
  border-bottom: solid 1.5px #060606;
  @media (max-width: 768px) {
    display: none;
  }
`;
const VectorBottom = styled.div`
  display: none;
  @media (max-width: 768px) {
    margin-top: 16px;
    width: 100%;
    height: 1px;
    border-bottom: solid 1.5px #060606;
    display: block;
    padding-left: -20px;
  }
`;

const LogoStyle = styled.div`
  margin-top: 32px;
  justify-content: center;
  height: 46px;
  display: flex;
  @media (max-width: 768px) {
    margin: 27px auto;
    font-size: 48px;
  }
`;
const MainConteiner = styled.div`
  display: block;
  height: 600px;
  @media (max-width: 768px) {
    height: 100%;
  }
`;

export default function PersonPage() {
  return (
    <MainConteiner>
      <InfoConteiner>
        <Name>
          петр
          <div style={{ marginBottom: "-2px" }}></div>
          тапап
        </Name>
        <Position>начальник</Position>
        <VectorBottom />
      </InfoConteiner>
    </MainConteiner>
  );
}
